    color: 'primary', 
    cuantity: '21',
    icon: 'fa-boxes'
}

/* <!-- Total users --> */

let totalUsers = {
    title:' Total de usuarios', 
    color:'success', 
    cuantity: '79',
    icon:'fa-user-check'
}

/* <!-- Total Categories --> */

let totalCategories = {
    title:'Total de categorías' ,
    color:'warning',
    cuantity:'49',
    icon:'fa-award'
}

let cartProps = [productsInDB, totalUsers, totalCategories];

function ContentRowInfo(){
    const [productos, setProductos] = useState(null)
    useEffect( () => {
        sumaProductos(setProductos)
    }, [])

    return (
    <div className="row">
            
       <SmallCard producto={productos}/>
       <SmallCard producto={productos}/>
       <SmallCard producto={productos}/>
            </div>
      
    )
}

export default ContentRowInfo;
